    <title>403 - Adgang Forbudt</title>

      @font-face {
        font-family: "Lato";
        src: url("https://www.pricerunner.dk/files/fonts/Lato-Regular.woff")
            format("woff"),
          url("https://www.pricerunner.dk/files/fonts/Lato-Regular.ttf")
            format("truetype");
        font-weight: normal;
        font-style: normal;
      }

      @font-face {
        font-family: "Lato";
        src: url("https://www.pricerunner.dk/files/fonts/Lato-Bold.woff")
            format("woff"),
          url("https://www.pricerunner.dk/files/fonts/Lato-Bold.ttf")
            format("truetype");
        font-weight: 700;
        font-style: normal;
      }

      @font-face {
        font-family: "Lato";
        font-style: normal;
        font-weight: 900;
        src: local("PriceRunnerProSolid"), local("PriceRunnerProSolid"),
          url("https://www.pricerunner.dk/files/fonts/PriceRunnerProSolid.woff")
            format("woff"),
          url("https://www.pricerunner.dk/files/fonts/PriceRunnerProSolid.ttf")
            format("truetype");
      }

      html,
      body {
        height: 100%;
        margin: 0;
      }

      body {
        font-family: "Lato", "Helvetica Neue", "Calibri Light", Roboto,
          sans-serif;
        -webkit-font-smoothing: antialiased;
        -moz-osx-font-smoothing: grayscale;
        color: #331f28;
      }

      button {
        background: none;
        border: none;
        cursor: pointer;
      }
      .button {

        margin: 12px 0 0;
        border-radius: 4px;
        display: -webkit-inline-box;
        display: -ms-inline-flexbox;
        display: inline-flex;
        -webkit-box-align: center;
        -ms-flex-align: center;
        align-items: center;
        -webkit-box-pack: center;
        -ms-flex-pack: center;
        justify-content: center;
        border: 1px solid #0000;
        font-size: 1rem;
        height: 44px;
        padding: 0 20px;
        white-space: nowrap;
        cursor: pointer;

        border-color: #eb145f;
        background: #eb145f 50%;
        color: #fefefe;
        -webkit-transition: border-color 0.2s ease, background 0.2s ease,
          color 0.2s ease;
        transition: border-color 0.2s ease, background 0.2s ease,
          color 0.2s ease;
      }
      .button:disabled {
          transition: border-color 300ms ease 0s, background 300ms ease 0s, color 300ms ease 0s, transform 300ms ease 0s;
          cursor: not-allowed;
          background: #ebeff5;
          color: #5b6370;
          border: none;
      }

      .button:hover,
      .button:focus {
        border-color: #910737;
        background: #910737 radial-gradient(circle, #0000 1%, #eb145f 0) 50%/15000%;
        color: #fefefe;
      }

      .logo-small {
        display: none;
        margin-top: 10px;
        margin-left: 10px;
      }

      .logo-big {
        text-align: center;
        margin: 16px 0 24px;
      }

      .ghost {
        height: auto;
        max-width: 55%;
      }

      .container {
        margin: 0 auto;
      }

      .header {
        background: #fcf2f6;
        padding: 24px;
        text-align: center;
      }

      .heading {
        font-weight: 900;
        margin: 0 0 8px;
      }

      .sub-heading {
        margin-top: 0;
        font-size: 16px;
        font-weight: 600;
      }

      .content {
        text-align: center;
        padding-right: 24px;
        padding-left: 24px;
      }
      .ip {
        margin-top: 0;
        font-size: .8em;
      }
      .links {
        list-style: none;
        margin: 0 0 24px;
        padding: 0;
      }

      .links li {
        margin-bottom: 8px;
      }

      .links a {
        text-decoration: none;
        color: #282b30;
        border-color: #f4f5f9;
        background: #f4f5f9;
        display: inline-flex;
        align-items: center;
        justify-content: center;
        line-height: 1;
        border-radius: 100px;
        cursor: pointer;
        flex-shrink: 0;
        transition: background 200ms ease, color 200ms ease,
          border-color 200ms ease;
        height: 40px;
        padding: 0 24px;
      }

      .links a:hover {
        background-color: #eb145f;
        border-color: #eb145f;
        color: #fff;
      }

      .separator {
        display: none;
      }

      .disclaimer {
        line-height: 24px;
        font-size: 16px;
        margin-bottom: 40px;
        max-width: 700px;
        margin-left: auto;
        margin-right: auto;
      }

      .social {
        list-style: none;
        margin: 0 auto 16px;
        padding: 0;
        display: flex;
        justify-content: space-between;
        max-width: 300px;
      }

      .copyright {
        text-align: center;
        margin-bottom: 24px;
        font-size: 14px;
      }

      .copyright strong {
        margin: 4px 0 0;
        display: block;
      }

      .big-ghost {
        display: none;
      }
      .g-recaptcha div {
        display: inline-block
      }
      @media (min-width: 1025px) {
        .header {
          padding-top: 0;
          padding-right: 32px;
          padding-bottom: 0;
        }

        .content {
          padding-right: 32px;
        }

        .separator {
          border: 1px solid #d1d8e3;
          border-width: 1px 0 0 0;
          margin-top: 24px;
          margin-bottom: 24px;
          display: block;
        }

        .page-wrapper {
          display: flex;
          flex-direction: column;
          height: 100%;
        }

        .container {
          padding: 72px 0 72px 72px;
          flex: 1;
          align-self: center;
        }

        .logo-big {
          text-align: left;
        }

        .wrapper {
          display: flex;
          flex: 1;
        }

        .big-ghost {
          flex: 1;
          background: #fcf2f6;
          display: flex;
          padding: 0 24px;
          align-items: center;
          justify-content: center;
        }

        .image-wrapper {
          max-width: 500px;
        }

        .image-wrapper img {
          max-width: 100%;
        }

        .ghost {
          display: none;
        }

        .header {
          background: #fff;
          text-align: left;
        }

        .heading {
          font-size: 42px;
          margin: 0;
        }

        .sub-heading {
          margin: 0;
          margin-top: 4px;
          font-weight: bold;
          line-height: 24px;
        }

        .content {
          text-align: left;
        }

        .content h3 {
          font-size: 12px;
          font-weight: bold;
        }

        .footer {
          padding: 0 24px;
        }

        .social {
          text-align: left;
          margin: 0 0 16px;
        }

        .copyright {
          text-align: left;
        }
      }
